import React, { useState } from "react";
import { FaHome, FaPlus, FaClipboardList, FaSignOutAlt } from "react-icons/fa";
import styles from "./LandlordDashboard.css";

const LandlordDashboard = () => {
  const [houses, setHouses] = useState([
    { id: 1, location: "Nairobi, Westlands", price: 20000, category: "Single Room", status: "Approved" },
    { id: 2, location: "Nairobi, Kilimani", price: 35000, category: "One-Bedroom", status: "Pending Approval" },
  ]);

  const [bookings, setBookings] = useState([
    { id: 1, clientName: "John Doe", houseLocation: "Nairobi, Kilimani", status: "Pending" },
    { id: 2, clientName: "Jane Smith", houseLocation: "Nairobi, Westlands", status: "Confirmed" },
  ]);

  const [newHouse, setNewHouse] = useState({ location: "", price: "", category: "" });

  const handleAddHouse = () => {
    if (!newHouse.location || !newHouse.price || !newHouse.category) {
      alert("Please fill all house details before submitting.");
      return;
    }

    alert(`To post your house, please send payment to **0710464858** via M-Pesa.`);
    setHouses([...houses, { ...newHouse, id: houses.length + 1, status: "Pending Approval" }]);
    setNewHouse({ location: "", price: "", category: "" });
  };

  return (
    <div className={styles.dashboardContainer}>
      {/* Sidebar Navigation */}
      <aside className={styles.sidebar}>
        <h2>Landlord Panel</h2>
        <ul>
          <li><FaHome /> My Houses</li>
          <li><FaClipboardList /> Booking Requests</li>
          <li><FaPlus /> Add House</li>
          <li className={styles.logout}><FaSignOutAlt /> Logout</li>
        </ul>
      </aside>

      {/* Main Content */}
      <div className={styles.mainContent}>
        <h2>Dashboard</h2>

        {/* My Houses */}
        <div className={styles.section}>
          <h3>My Houses</h3>
          <div className={styles.grid}>
            {houses.map((house) => (
              <div key={house.id} className={styles.houseCard}>
                <p><strong>Location:</strong> {house.location}</p>
                <p><strong>Price:</strong> KSh {house.price}</p>
                <p><strong>Category:</strong> {house.category}</p>
                <p><strong>Status:</strong> <span className={house.status === "Approved" ? styles.approved : styles.pending}>{house.status}</span></p>
              </div>
            ))}
          </div>
        </div>

        {/* Booking Requests */}
        <div className={styles.section}>
          <h3>Booking Requests</h3>
          {bookings.length === 0 ? <p>No booking requests yet.</p> : (
            bookings.map((booking) => (
              <div key={booking.id} className={styles.bookingCard}>
                <p><strong>Client:</strong> {booking.clientName}</p>
                <p><strong>House Location:</strong> {booking.houseLocation}</p>
                <p><strong>Status:</strong> {booking.status}</p>
              </div>
            ))
          )}
        </div>

        {/* Add House */}
        <div className={styles.section}>
          <h3>Add New House</h3>
          <input type="text" placeholder="Location" value={newHouse.location} onChange={(e) => setNewHouse({ ...newHouse, location: e.target.value })} />
          <input type="number" placeholder="Price (KSh)" value={newHouse.price} onChange={(e) => setNewHouse({ ...newHouse, price: e.target.value })} />
          <select value={newHouse.category} onChange={(e) => setNewHouse({ ...newHouse, category: e.target.value })}>
            <option value="">Select Category</option>
            <option value="Single Room">Single Room</option>
            <option value="One-Bedroom">One-Bedroom</option>
            <option value="Bedsitter">Bedsitter</option>
          </select>
          <button className={styles.addButton} onClick={handleAddHouse}>Post House</button>
        </div>
      </div>
    </div>
  );
};

export default LandlordDashboard;
